import logo from './logo.svg';
import './App.css';
import Styled from 'styled-components';

const Logo = Styled.div > img `
  width: 100px;
`;

function App() {
  return (
    <div className="App">
      <header>
        <Logo><img src="./logo.png" /></Logo>
        </header>
    </div>
  );
}

export default App;
